import React from 'react';

class TypingGame extends React.Component {
  
  constructor(props) {
    super(props);
    this.state = {
      words: [
        "Hello",
        "Man"
      ],
      
      score: 0
    };
  }


  render() {
    return (
      <div className="typingTest">
        <div>{this.state.words.map((word) =>
          <span>{word}</span>
        )}
        </div>
        <input />
        <div>Score: {this.state.score}</div>
      </div>
    );
  }

}

export default TypingGame;
